	public GLP1000_ServerGraph() {
		try{
			servers = new Server[3626];
			network = new Network();

			createServers1();
			createServers2();
			createServers3();
			createServers4();
			createServers5();
			createServers6();
			createServers7();
			createServers8();

			new GLP1000_ServerGraph2( network, servers );
			new GLP1000_ServerGraph3( network, servers );
			new GLP1000_ServerGraph4( network, servers );
			new GLP1000_ServerGraph5( network, servers );
			new GLP1000_ServerGraph6( network, servers );
		} catch (Exception e) {
			e.printStackTrace();
		}
	}

